import React from 'react'
import Nav from './Components/Nav'
import bank_image from './images/bank_image.jpg'
import './App.css'
import { Formik, Form, Field, ErrorMessage } from 'formik';


function Login() {
  return (
    <main>
        <Nav />
        <div className='login_wrapper'>
            <div className='login_image_wrapper'>
                <img src={bank_image}/>
            </div>
            <div className='login_content'>
                    <h2>Login</h2>
                    <p>Don't have an account? <a href='/signup'>signup</a></p>
                    <Formik
                        initialValues={{ logo: '', brand_name: '' }}
                        validate={values => {
                        const errors = {};
                        if (!values.logo) {
                            errors.logo = 'Required';
                        }
                        if (!values.brand_name) {
                            errors.brand_name = 'Required';
                        }
                        return errors;
                        }}
                        onSubmit={(values, { setSubmitting }) => {
                        handleSubmit(values.logo, values.brand_name, setSubmitting);
                        }}
                    >
                        {({ isSubmitting }) => (
                        <Form>
                            <label>Logo: </label>
                            <Field type="text" name="logo" />
                            <ErrorMessage name="logo" component="div" />
                            <br />

                            <label>Brand Name: </label>
                            <Field type="brand_name" name="brand_name" />
                            <ErrorMessage name="brand_name" component="div" />
                            <br />

                            <button type="submit" disabled={isSubmitting}>
                            Submit
                            </button>
                        </Form>
                        )}
                    </Formik>

            </div>

        </div>


    </main>
  )
}

export default Login
